@juditecypreste @MelhorNemSeguir Enfim, mostrei a foto e perguntei Heitor: ele disse que já viu, aí eu perguntei o que ela disse "nada, ela é muito feia, eu tirei"
Gabi: apenas começa a chorar 
Ambos os casos não dá pra afirmar nada, já que podem ter visto um vídeo da Momo aleatório no próprio yt.

